import React from "react";
import MainContent from "./MainContent";

class Map extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="map">
        <img src="https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwilzJvJ28fjAhUkmuAKHcHAC1EQjRx6BAgBEAU&url=https%3A%2F%2Fparking.illinois.edu%2Fvisitors%2Fcampus-maps%2Fcampus-parking-map&psig=AOvVaw0q-_JR-Ebp_M55NWIV-EI4&ust=1563857030416919" />
      </div>
    );
  }
}

export default Map;
